import React from 'react';
import DataFetcher from './DataFetcher.js';
import UserDetails from './UserDetails.js';

function Users() {
  return (
    <div>
      <h2>Users</h2>
      <div><DataFetcher/></div>
      <div><Provider><UserDetails/></Provider></div>
    </div>
  );
}

export default Users;
